    def maxSumOfThreeSubarrays(self, nums, k):
        """
        :type nums: List[int]
        :type k: int
        :rtype: List[int]
        """
        n = len(nums)
        nums2 = [sum(nums[:k])]
        for i in range(k, n):
            nums2.append(nums2[-1] + nums[i] - nums[i - k])

        last1 = [(nums2[-1], n - k)]
        for i in range(n - k - 1, -1, -1):
            if nums2[i] >= last1[-1][0]:
                last1.append((nums2[i], i))
            else:
                last1.append(last1[-1])
        last1.reverse()

        last2 = [(nums2[n - 2 * k] + last1[-1][0], n - 2 * k)]
        for i in range(n - 2 * k - 1, -1, -1):
            if nums2[i] + last1[i + k][0] >= last2[-1][0]:
                last2.append((nums2[i] + last1[i + k][0], i))
            else:
                last2.append(last2[-1])
        last2.reverse()

        min1, theMax = float('-inf'), 0
        for i in range(n - 3 * k + 1):
            if nums2[i] > min1:
                min1 = nums2[i]
                sum2, j = last2[i + k]
                if min1 + sum2 > theMax:
                    theMax = min1 + sum2
                    seq = i, j, last1[j + k][1]
        return seq


